import React, { useState, useEffect } from "react";
import "./App.css";
import { Meme } from "./components/Meme";
import {
  FacebookShareButton,
  FacebookIcon,
  TwitterShareButton,
  TwitterIcon,
  TumblrShareButton,
  TumblrIcon,
  TelegramShareButton,
  TelegramIcon,
  WhatsappShareButton,
  WhatsappIcon,
  RedditShareButton,
  RedditIcon,
} from "react-share";
import MemeCreator from "./MemeCreator";

const objectToQueryParam = (obj) => {
  const params = Object.entries(obj).map(([key, value]) => `${key}=${value}`);

  return "?" + params.join("&");
};
function App() {
  return MemeCreator();
}

export default App;
